import React from 'react';
import styles from './StartScreen.module.css';
import { startFlagQuiz } from '../modes/FlagQuiz.js';
import { startCapitalQuiz } from '../modes/CapitalQuiz.js';

const StartScreen = ({ onStart }) => {  return (
    <div className={styles.card}>
      <h1 className={styles.title}>Geography Quiz</h1>
      <div className={styles.buttonContainer}>
        <button className={styles.uttonbPrimary} onClick={startFlagQuiz}>Guess the Flag</button>
        <br></br>
        <br></br>
        <button className={styles.buttonPrimary} onClick={startCapitalQuiz}>Guess the Capital</button>
      </div>
    </div>
  );
};

export default StartScreen;
